import React, { Component } from "react";
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Home from "./Home";
import Stuff from "./Stuff";
import Contact from "./Contact";
 
class Main extends Component {
  render() {
    return (
            <BrowserRouter>
        <div>
          <h1>Simple SPA</h1>
          <ul className="header">
          </ul>
          <div className="content">
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="expenses" element={<Stuff />} />
                <Route path="invoices" element={<Contact />} />
              </Routes>
          </div>
        </div>
            </BrowserRouter>
    );
  }
}
 
export default Main;
